import 'firebase/database';


import './index.css';

var firebaseConfig = {
    apiKey: "AIzaSyDYhpvPpuxNMQ_ETOTqETTbQk6HwI_Plto",
    authDomain: "info340project2.firebaseapp.com",
    databaseURL: "https://info340project2.firebaseio.com",
    projectId: "info340project2",
    storageBucket: "info340project2.appspot.com",
    messagingSenderId: "152670952319",
    appId: "1:152670952319:web:b21f01d3064b3f4f35584a",
